from Crypto.Util.number import *

p = getPrime(700)
q = getPrime(700)
n = p*q

e1 = 3*getPrime(16)
e2 = 3*getPrime(16)

flag = b'NSSCTF{******}'
c1 = pow(bytes_to_long(flag), e1, n)
c2 = pow(bytes_to_long(flag), e2, n)

print(f'n = {n}')
print(f'e1 = {e1}')
print(f'e2 = {e2}')
print(f'c1 = {c1}')
print(f'c2 = {c2}')

